import { PopupWithForm } from './PopupWithForm';

function PopupRemoveCard({ isOpened, onClose }) {
  return (
    <Popup>
      <PopupWithForm
        popupType="remove-card"
        name="Вы уверены?"
        isOpened={isOpened}
        onClose={onClose}
        buttonText={'Да'}
      />
    </Popup>
  );
}

export { PopupRemoveCard };
